sourcesContent:
import styled from "styled-components";

export const Container = styled.div`
 max-width : 1120px;
 width: 98%;
 margin: 0 auto;
 display: flex;
 gap: 20px;
 margin-top: -50px;
 justify-content: space-around;
 box-Shadow: 9px 9px 15px 0px
`;
